import { Switch, Route, BrowserRouter } from 'react-router-dom';

import Home from './components/home/Home';

function App() {

	return (
		<div className="App">
			<div className="title">CryptoApp 1.6</div>
			<BrowserRouter>
				<Switch>
					<Route path="/home" component={Home} />
				</Switch>
			</BrowserRouter>
		</div>
	);
}

export default App;
